import { BaseApi, User } from "./common";

/**
 * Get user by id
 */
export type GetUser = BaseApi<{
  url: "/users/{userId}";
  method: "GET";
  paths: {
    /**
     * 用户id
     */
    userId: string;
  };
  response: { 200: User };
}>;

export type CreateUser = BaseApi<{
  url: "/users";
  method: "POST";
  body: {
    /**
     * 用户
     */
    user: Omit<User, "id">;
  };
  response: { 201: User };
}>;

export type UpdateUser = BaseApi<{
  url: "/user/{userId}";
  method: "PUT";
  paths: {
    /**
     * 用户id
     */
    userId: string;
  };
  body: {
    /**
     * 用户
     */
    user: Omit<User, "id">;
  };
  response: { 201: User };
}>;

export type DeleteUser = BaseApi<{
  url: "/user/{userId}";
  method: "DELETE";
  paths: {
    /**
     * 用户id
     */
    userId: string;
  };
  response: { 204: null };
}>;

